const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Caster</li><li>True Name: Lord El-Melloi II / Zhuge Kongming</li><li>Gender: Male</li><li>Source: Annals of the Three Kingdoms historical novel</li><li>Region: Chinese</li><li>Alignment: Neutral Good</li><li>Height: 186 cm</li><li>Weight: 68 kg (Third ascension has his height at 157cm and weight at 50kg)</li></ul><p><strong>Meta</strong></p><ul><li>Setting creation: Higashide Yuuichirou</li><li>Character design: Takeuchi Takashi</li><li>CV: Namikawa Daisuke</li><li>Main works appearance: Fate/Zero</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B+</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">A</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Territory Creation: [A]</strong></p><p>Creation of a &quot;Workshop&quot; territory that is advantageous to himself as a magus.</p><p>It\u2019s possible to create the \u201CSh\xED B\u012Bng B\u0101 Zh\xE8n\u201D that surpasses \u201CWorkshop\u201D.</p><p><strong>Tool Creation: [B]</strong></p><p>By borrowing Zhuge Kongming\u2019s power, he is capable of creating various arms and tools from his legend, such as the repeating crossbow. However, only the drug of immortality that Kongming had failed to acquired cannot be created.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Discerning Eye: [A]</strong></p><p>A narrower version technique of Human Observation.</p><p>He is exceedingly outstanding in judging in what manners a human target would acquired usefulness in the future.</p><p>However, in order to do that it is necessary for him to understand the target\u2019s weak and strong point by means of conversation and looking at the target\u2019s appearance to an extent.</p><p><strong>Advice of the Strategist: [A+]</strong></p><p>A Skill bestowed to Servants of the strategist type.</p><p>By means of understanding and analysis of the situation, he is able to grants correct advice to allies.</p><p>The higher the rank, the higher the chance of said advice to be correct. On A+ rank, no matter what sorts of unforeseen circumstances is included, said advice will always hit the mark 100%.</p><p>Opposing it requires a luck on the level that can defeat any and every kind of analysis, or possession of the Skill*.</p><p><strong>Command of the Strategist: [A+]</strong></p><p>A Skill bestowed to Servants of the strategist type. It brings forth the maximum power of an army one belongs to.</p><p>On A+ rank, it possesses the power equal to that of death troops determined to fight to the death as they exhaust their life.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="kaerazu-no-jin-shi-bing-ba-zhen-1" tabindex="-1"><a class="header-anchor" href="#kaerazu-no-jin-shi-bing-ba-zhen-1" aria-hidden="true">#</a> Kaerazu no Jin - Sh\xED B\u012Bng B\u0101 Zh\xE8n [1]</h1><ul><li>Rank: C</li><li>Type: Anti-Army Noble Phantasm</li><li>Range: 50</li><li>Maximum target: 500 person</li></ul><p>Formation of No Return.</p><p>A formation laid by a certain famous strategist upon deciding his army\u2019s retreat.</p><p>The formation of huge rocks bewilders invaders and drives them to death.</p><p>As a Noble Phantasm, it is a great thaumaturgy that compulsorily alters the location of the enemy into the Sh\xED B\u012Bng B\u0101 Zh\xE8n.</p><p>As long as they do not escape from within it, the enemies becomes targets of additional damage that accumulates every turn.</p><h1 id="suishi-no-hyou-chu-shi-biao-2" tabindex="-1"><a class="header-anchor" href="#suishi-no-hyou-chu-shi-biao-2" aria-hidden="true">#</a> Suishi no Hyou - Chu Shi Biao [2]</h1><ul><li>Rank: EX</li><li>Type: Anti-Army Noble Phantasm (his own army)</li><li>Range: 0</li><li>Maximum target: 100 person</li></ul><p>Table of Expedition.</p><p>The report for the throne that Zhuge Kongming left behind for the still young emperor when he organized the army for the subjugation of the enemy nation. A text that composed ardently his readiness to completely devote himself for loyalty, it would then be praised as most famous amongst famed literary composition in later years. Its effect as a Noble Phantasm is unknown.</p><p>(In FateGO it is fundemantally not utilized.)</p>', 39);
