const _hoisted_53 = /* @__PURE__ */ createStaticVNode('<h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First pronoun: watashi</li><li>Second pronoun: omae</li><li>Third pronoun: kare/kanojo</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>His personality is that of Lord El-Melloi II.</p><p>He is a slightly moody sort of magus with a meddlesome nature at the root, which ends up giving heavy influence to the people on his surroundings.</p><p>He is particularly good at deciding courses of action; countless people have discovered their own ability thanks to him.</p><p>Although, it can\u2019t be denied that at the same time he himself possesses a complex in regards to his own powerlessness\u2026.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>He mostly looks after the Master basically as one of his student.</p><p>El-Melloi II, who had taken in Kongming\u2019s knowledge, have an overwhelmingly abundant experience on his hand compared to the many magi in this world. Consequently, the Master becomes his student from the beginning.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u201CServant, Zhuge Kongming. ...Hm, you think I\u2019m not him?</p><p>Indeed I am not. I am El-Melloi II. Nevertheless, I do inherit his power. There is no problem.\u201D</p><p>\u201CThings I am fond of? Let us see\u2026 Pupils with good perception, classroom filled with silence, and colleagues whose head are not clogged with tofu\u2026 I suppose.\u201D</p><p>\u201CAs you can see, I am in the middle of my game. We can speak, but don\u2019t tamper with my hair. It\u2019s distracting me from levelling up.\u201D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>The description below is not of Zhuge Kongming, but of the basis of his outer shell, Lord El-Melloi II.</p><p>Lord El-Melloi II is the representative head of House El-Melloi, one of the twelve nobles that rule over and manage the Clock Tower that is the center of Magic Association. A lecturer of the department of Modern Magic, all of his pupils had managed to grow into excellent magi.</p><p>It is said that should he ever recruit his pupils to his own faction, the Clock Tower\u2019s influence chart would easily change; but he himself has no intention to do so.</p><p>His insight in observing the true nature of a human has reached the point of being sublimated as a Servant\u2019s Skill. No matter how much a famed magus may conceal his or her thaumaturgy, he possesses the terrifying ability to divulge it without any constraint.</p><p>Normally, even if the outer shell is El-Melloi II, in the inside is still Zhuge Kongming and he should have conduct himself as Zhuge Kongming. However, upon the agreement of the goal of protecting the Human Order, there is no problem whichever between the two that holds the reign of the body; in the end of the discussion, Lord El-Melloi with his discernment of the modern world was decided to become a Servant.</p><p>Although he himself is dissatisfied of being unable to do something with his own power, he do understand that he would not be able to do anything alone. He vows that he will protect the Human Order together with the other Servants.</p><p>Furthermore, there is no change of his very power as a Servant or in his knowledge quantity upon his repeating spirit foundation\u2019s ascension, which in the end returns his form to that of a young boy (roughly 19 years old).</p><p>According to a certain ill-natured goddess, the situation of him fighting as the leading part being his form as a young boy is most fitting. Perhaps for Lord El-Melloi II himself, the unforgettable battle in which he shines the most is the one of this moment.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Alexander</strong></p><p>A man of great talent, still unfinished in his growth. And yet, there is already enough of his charisma that it reminds me of his dignity back in the day. ...Well, in that case, I would like to see with my own eyes of what would happen that changes him.</p><p><strong>Iskander</strong></p><p>Things like the memory when he had been summoned are haziness, not even a dream for the current him. I know that much already. I know, and still.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>The idea of the third ascension being Waver felt like a good idea when it struck me, but upon the implementation I felt somewhat anxious if it would be a disappointing development for those who like El-Melloi II. I am really relieved that I don\u2019t need to worry about that thanks to the option of being able to choose the ascension stage. (Takeuchi Takashi)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-336.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-337.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-338.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-339.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-340.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-341.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-342.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-343.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 43);
